package com.alex.blog.model;import com.alex.blog.base.BaseModel;import java.util.Date;/** * 登陆信息表 Model * * @author alex * @date 2019-09-09 22:24:02 */public class BlogUserLogin extends BaseModel {		/** 	* 自增id	*/	private Integer userId;	/** 	* 用户openId	*/	private String openId;	/** 	* 账号	*/	private String account;	/** 	* 密码	*/	private String password;	/** 	* 手机号	*/	private String mobile;	/** 	* 邮箱	*/	private String email;	/** 	* 密码过期时间	*/	private Integer passwordExpiryDate;	/** 	* 账号状态：1 正常，2 锁定	*/	private Integer accountStatus;	/** 	* 登陆失败次数	*/	private Integer failedLogins;	/** 	* 创建时间	*/	private Date createTime;	/** 	* 更新时间	*/	private Date updateTime;		public Integer getUserId() {	    return this.userId;	}	public void setUserId(Integer userId) {	    this.userId=userId;	}	public String getOpenId() {	    return this.openId;	}	public void setOpenId(String openId) {	    this.openId=openId;	}	public String getAccount() {	    return this.account;	}	public void setAccount(String account) {	    this.account=account;	}	public String getPassword() {	    return this.password;	}	public void setPassword(String password) {	    this.password=password;	}	public String getMobile() {	    return this.mobile;	}	public void setMobile(String mobile) {	    this.mobile=mobile;	}	public String getEmail() {	    return this.email;	}	public void setEmail(String email) {	    this.email=email;	}	public Integer getPasswordExpiryDate() {	    return this.passwordExpiryDate;	}	public void setPasswordExpiryDate(Integer passwordExpiryDate) {	    this.passwordExpiryDate=passwordExpiryDate;	}	public Integer getAccountStatus() {	    return this.accountStatus;	}	public void setAccountStatus(Integer accountStatus) {	    this.accountStatus=accountStatus;	}	public Integer getFailedLogins() {	    return this.failedLogins;	}	public void setFailedLogins(Integer failedLogins) {	    this.failedLogins=failedLogins;	}	public Date getCreateTime() {	    return this.createTime;	}	public void setCreateTime(Date createTime) {	    this.createTime=createTime;	}	public Date getUpdateTime() {	    return this.updateTime;	}	public void setUpdateTime(Date updateTime) {	    this.updateTime=updateTime;	}}